INSERT INTO `v1_9b45900503d4971c37f980110843b32becb34dccb9ef82206f569426d2047617` VALUES (11601, 0.75, "ツムギのボトルキャップ", 0.625, 6, "ツムギ・オンステージ！ツムギがキャップのステージでかわいく\nポーズを決めている。どこでも好きな場所に気軽に飾ることが可\n能。", 1);
INSERT INTO `v1_9b45900503d4971c37f980110843b32becb34dccb9ef82206f569426d2047617` VALUES (11602, 0.75, "ツムギのサマーボトルキャップ", 0.625, 6, "サマー衣装のツムギが、キャップでオンステージ！涼しげな衣装を\nまとい、熱いステージを繰り広げた彼女の勇姿を思い出すことがで\nきる。", 1);
INSERT INTO `v1_9b45900503d4971c37f980110843b32becb34dccb9ef82206f569426d2047617` VALUES (11603, 0.75, "ノゾミのボトルキャップ", 0.625, 6, "ノゾミ・オンステージ！ノゾミがキャップのステージでかわいく\nポーズを決めている。どこでも好きな場所に気軽に飾ることが可\n能。", 1);
